import{_ as e,c as l,o as a,ae as i}from"./chunks/framework.PlHSbJXJ.js";const h=JSON.parse('{"title":"毕设定制","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"graduation-project/index.md","filePath":"graduation-project/index.md"}'),d={name:"graduation-project/index.md"};function r(n,t,s,o,p,x){return a(),l("div",null,t[0]||(t[0]=[i('<h1 id="毕设定制" tabindex="-1">毕设定制 <a class="header-anchor" href="#毕设定制" aria-label="Permalink to &quot;毕设定制&quot;">​</a></h1><p>毕设工坊提供完整的计算机毕业设计定制和指导服务。这里需要特别声明，毕设工坊的系统定制是真正的一点点做起来的，不是在网上找一套源码就给客户了。我们的团队技术人员平均工作年年限8年多，有毕设需要的完整技术体系，开发技术覆盖了各大主流开发语言和框架。</p><p>以下是我们目前技术能力能够很好覆盖的业务范围：</p><table tabindex="0"><thead><tr><th style="text-align:left;">开发语言</th><th style="text-align:left;">技术框架</th><th style="text-align:left;">开发工具</th></tr></thead><tbody><tr><td style="text-align:left;">Java</td><td style="text-align:left;">SpringBoot<br>SSM<br>Servlet<br>JSP<br>SpringCloud</td><td style="text-align:left;">IDEA<br>Eclipse<br>MyEclipse</td></tr><tr><td style="text-align:left;">PHP</td><td style="text-align:left;">ThinkPHP<br>原生PHP<br>Laravel</td><td style="text-align:left;">phpstudy<br>wampserver<br>phpenv</td></tr><tr><td style="text-align:left;">Python</td><td style="text-align:left;">Flask<br>Django</td><td style="text-align:left;">PyCharm</td></tr><tr><td style="text-align:left;">Node</td><td style="text-align:left;">Express<br>Koa</td><td style="text-align:left;">VsCode</td></tr><tr><td style="text-align:left;">C#</td><td style="text-align:left;">Asp.net</td><td style="text-align:left;">Visual Studio</td></tr><tr><td style="text-align:left;">小程序</td><td style="text-align:left;">Uniapp</td><td style="text-align:left;">微信开发者工具</td></tr><tr><td style="text-align:left;">安卓APP</td><td style="text-align:left;">Uniapp</td><td style="text-align:left;">Hbuildx<br>Android-Studio</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>毕设工坊项目的背景缘于一次兼职。</p><p>当时被朋友拉到了一个兼职群里，里面每天都有人发一些小的项目开发需求单，群里都是技术兼职人员。后来了解到主要就是做计算机毕设的，群主会从每单的成交额里面抽取30% - 50%的提成。举个例子如果有个毕设单子，群里的技术人员和客户那边谈好的价格是1000元，那么技术人员实际到手只有500-700元。技术人员赚的钱少，就想方设法的减少工作量降低成本，至于售后那是不用想的。大部分技术人员会去找一些开源的项目，简单改一下就发给客户了。那些定制比较多，修改次数多的单子基本就直接放弃了。这应该就是广大“计院”专业的学生做毕设被骗的主要的原因吧。</p></div><h2 id="定制流程" tabindex="-1">定制流程 <a class="header-anchor" href="#定制流程" aria-label="Permalink to &quot;定制流程&quot;">​</a></h2><ol><li>咨询客服</li><li>确认需求</li><li>付定金-在第三方平台担保交易</li><li>技术开发</li><li>技术开发完成-提供演示地址</li><li>客户不需要修改-付尾款-申请代码</li><li>客户需要修改-提交需要修改的问题-验收通过-付尾款-申请代码</li><li>项目部署</li><li>部署后如果发现还有地方需要修改，只需继续提交需要修改的问题</li></ol><h2 id="开发周期" tabindex="-1">开发周期 <a class="header-anchor" href="#开发周期" aria-label="Permalink to &quot;开发周期&quot;">​</a></h2><p>一般情况下，自下单那天开始一周内即可进行交付。</p><h2 id="售后服务" tabindex="-1">售后服务 <a class="header-anchor" href="#售后服务" aria-label="Permalink to &quot;售后服务&quot;">​</a></h2><p>所有项目包售后修改部署等。</p>',11)]))}const c=e(d,[["render",r]]);export{h as __pageData,c as default};
